# result = {'text': " A few years ago, I broke into my own house. I had just driven home. It was around midnight in the dead of Montreal winner. I'd been visiting my friend Jeff across town. And the thermometer on the front porch read minus 40 degrees. And don't bother asking if that sells you sir. Fahrenheit minus 40 is where the two scales meet. It was very cold. And as I stood on the front porch fumbling in my pockets, I found I didn't have my keys. In fact, I could see them through the window, lying on the dining room table where I had left them. So I quickly ran around and tried all the other doors and windows and they were locked tight. I thought about calling a locksmith, at least I had my cell phone. But at midnight, it could take a while for a locksmith to show up. And it was cold. I couldn't go back to my friend Jeff's house for the night because I had an early flight to Europe the next morning and I needed to get my passport in my suitcase. So desperate and freezing cold, I found a large rock and I broke through the basement window, cleared out the shards of glass. I crawled through. I found a piece of cardboard and taped it up over the whole opening, figuring that in the morning, on the way to the airport, I could call my contractor and ask him to fix it. This was going to be expensive, but probably no more expensive than the middle of the night locksmith. So I figured under the circumstances I was coming out even. Now I'm a neuroscientist by training and I know a little bit about how the brain performs under stress. It releases cortisol, that raises your heart rate, it modulates adrenaline levels and it clouds your thinking. So the next morning, when I woke up on too little sleep, worrying about the hole in the window and the mental note that I had to call my contractor and the freezing temperatures and the meetings I had upcoming in Europe. And you know, with all the cortisol in my brain.", 'segments': [{'id': 0, 'seek': 0, 'start': 0.0, 'end': 19.2, '